import Form from 'react-bootstrap/Form'
import Button from 'react-bootstrap/Button'
import Card from 'react-bootstrap/Card'
import Container from 'react-bootstrap/Container';
import { Col } from 'react-bootstrap';

function Signup() {
    const [windowWidth, setWidth] = useState('100%');
    const [windowHeight, setHeight] = useState('100%');
    // const [color, setColor] = useState('blue');

    const changeSize = () => {
        setWidth('100%');
        setHeight('100%');
        // setColor('red')
    }

    window.addEventListener("orientationchange", changeSize)

    return (
        <div style={{ backgroundColor: '#17223B', height: windowHeight, width: windowWidth }}>
            <Container style={{ backgroundColor: 'white', }} >
                <Form style={{ backgroundColor: 'red', }}>
                    <Form.Group controlId="email">
                        <Form.Control style={{}} type="text" placeholder='Username' />
                    </Form.Group>
