                            <Form.Group controlId="password">
                                <Form.Control type="password" placeholder="Password" />
                            </Form.Group>

                            <Button variant="primary" type="submit">
                                Submit
                        </Button> */}
                </Form >
            </Container >
        </div >
    );
}

export default Signup;
